import React from "react";
import styled from "styled-components";
import { Button } from "react-native";
import { Icon } from "react-native-elements";
import { Ionicons } from "@expo/vector-icons";
import { FontAwesome5 } from "@expo/vector-icons";
const Card = props => (
  <Container>
    <DayContainer>
      <Days>Today</Days>
      <Days>Tomorrow</Days>
    </DayContainer>

    <Content>
      <Row>
        <Title>Now</Title>
        <RoundContainer>
          <Ionicons
            name="ios-water"
            style={{ textAlign: "center" }}
            size={28}
            color="blue"
          />
          <NumberText>75Â°</NumberText>
        </RoundContainer>
      </Row>
    </Content>
  </Container>
);

export default Card;

//Whole Card
const Container = styled.View`
  background: transparent;
  width: 99%;
  height: 27%;
  margin: 2px 2px;
  box-shadow: 0 5px 15px rgba(0, 0, 0, 0.15);
`;
const DayContainer = styled.View`
  flex-direction: row;
  display: flex;
`;

const Content = styled.View`
  flex-direction: row;
  display: flex;
  border: 1px solid white;
`;

//LakeName
const Title = styled.Text`
  color: white;
  font-size: 14px;
  margin-left: 7%;
`;
const Days = styled.Text`
  color: white;
  font-size: 20px;
  margin-left: 5%;
  margin-bottom: 5%;
  font-weight: bold;
`;
const NumberText = styled.Text`
  color: white;
  font-size: 18px;
  padding-top: 20%;
  text-align: center;
`;

const Distance = styled.Text`
  color: white;
  font-size: 16px;
  padding-bottom: 8%;
  margin-left: 20px;
`;
//Container Information Start
const RoundContainer = styled.View`
  border-radius: 80px;
  border: 1px solid gray;
  width: 12%;
  height: 80%;
  margin-left: 5%;
`;

const Row = styled.View`
  flex: 1;
  flex-direction: column;
`;
